[Convolution3D]
	filters = 32
	kernel_size = (5,5,10)
		[kwargs]
		kernel_initializer = he_normal
		input_shape = (20,10,60,1)
		padding = same
		strides = (2,2,6)

[BatchNormalization]

[Activation]
	activation = relu

[Dropout]
	rate = 0.4

[Convolution3D]
	filters = 64
	kernel_size = (2,2,2)
		[kwargs]
		kernel_initializer = he_normal
		padding = same

[BatchNormalization]

[Activation]
	activation = relu

[Dropout]
	rate = 0.4

[Flatten]

[Dropout]
	rate = 0.4

[Dense]
	units = 1024
	[kwargs]
	kernel_initializer = normal
	activation = relu

[Dropout]
	rate = 0.4

[Dense]
	units = 1
	[kwargs]
	kernel_initializer = normal
	activation = linear

